	return [(Is+(2*lsa*lsb*(mb+(ms+2*mt))+((lsb)^(2)*(mb+(ms+2*mt))+(lsa)^(2)*(mb+2*(ms+mt))))) (lsa+lsb)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos((q1+-1*q2)) 1/2*lb*(lsa+lsb)*mb*cos((q1+-1*q3)) -1*(lsa+lsb)*(lta*ms+ltb*(ms+mt))*cos((q1+-1*q4)) -1*lsb*(lsa+lsb)*ms*cos((q1+-1*q5)) -1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*cos(q1) -1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*sin(q1) (lsa+lsb)*cos(q1) (lsa+lsb)*sin(q1);(lsa+lsb)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos((q1+-1*q2)) (It+(2*lta*ltb*(mb+(ms+mt))+((ltb)^(2)*(mb+(ms+mt))+(lta)^(2)*(mb+(ms+2*mt))))) 1/2*lb*(lta+ltb)*mb*cos((q2+-1*q3)) -1*(lta+ltb)*(lta*ms+ltb*(ms+mt))*cos((q2+-1*q4)) -1*lsb*(lta+ltb)*ms*cos((q2+-1*q5)) -1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos(q2) -1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*sin(q2) (lta+ltb)*cos(q2) (lta+ltb)*sin(q2);1/2*lb*(lsa+lsb)*mb*cos((q1+-1*q3)) 1/2*lb*(lta+ltb)*mb*cos((q2+-1*q3)) (Ib+1/4*(lb)^(2)*mb) 0 0 -1/2*lb*mb*cos(q3) -1/2*lb*mb*sin(q3) 0 0;-1*(lsa+lsb)*(lta*ms+ltb*(ms+mt))*cos((q1+-1*q4)) -1*(lta+ltb)*(lta*ms+ltb*(ms+mt))*cos((q2+-1*q4)) 0 (It+((lta)^(2)*ms+(2*lta*ltb*ms+(ltb)^(2)*(ms+mt)))) lsb*(lta+ltb)*ms*cos((q4+-1*q5)) (lta*ms+ltb*(ms+mt))*cos(q4) (lta*ms+ltb*(ms+mt))*sin(q4) -1*(lta+ltb)*cos(q4) -1*(lta+ltb)*sin(q4);-1*lsb*(lsa+lsb)*ms*cos((q1+-1*q5)) -1*lsb*(lta+ltb)*ms*cos((q2+-1*q5)) 0 lsb*(lta+ltb)*ms*cos((q4+-1*q5)) (Is+(lsb)^(2)*ms) lsb*ms*cos(q5) lsb*ms*sin(q5) -1*(lsa+lsb)*cos(q5) -1*(lsa+lsb)*sin(q5);-1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*cos(q1) -1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos(q2) -1/2*lb*mb*cos(q3) (lta*ms+ltb*(ms+mt))*cos(q4) lsb*ms*cos(q5) (mb+2*(ms+mt)) 0 -1 0;-1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*sin(q1) -1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*sin(q2) -1/2*lb*mb*sin(q3) (lta*ms+ltb*(ms+mt))*sin(q4) lsb*ms*sin(q5) 0 (mb+2*(ms+mt)) 0 -1;-1*(lsa+lsb)*cos(q1) -1*(lta+ltb)*cos(q2) 0 (lta+ltb)*cos(q4) (lsa+lsb)*cos(q5) 1 0 0 0;-1*(lsa+lsb)*sin(q1) -1*(lta+ltb)*sin(q2) 0 (lta+ltb)*sin(q4) (lsa+lsb)*sin(q5) 0 1 0 0]
end

function ImpactRHS(q1,q2,q3,q4,q5,q1d,q2d,q3d,q4d,q5d)
	return [((Is+(2*lsa*lsb*(mb+(ms+2*mt))+((lsb)^(2)*(mb+(ms+2*mt))+(lsa)^(2)*(mb+2*(ms+mt)))))*q1d+((lsa+lsb)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos((q1+-1*q2))*q2d+(1/2*lb*(lsa+lsb)*mb*cos((q1+-1*q3))*q3d+(-1*(lsa+lsb)*(lta*ms+ltb*(ms+mt))*cos((q1+-1*q4))*q4d+-1*lsb*(lsa+lsb)*ms*cos((q1+-1*q5))*q5d))));((lsa+lsb)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos((q1+-1*q2))*q1d+((It+(2*lta*ltb*(mb+(ms+mt))+((ltb)^(2)*(mb+(ms+mt))+(lta)^(2)*(mb+(ms+2*mt)))))*q2d+(1/2*lb*(lta+ltb)*mb*cos((q2+-1*q3))*q3d+(-1*(lta+ltb)*(lta*ms+ltb*(ms+mt))*cos((q2+-1*q4))*q4d+-1*lsb*(lta+ltb)*ms*cos((q2+-1*q5))*q5d))));(1/2*lb*(lsa+lsb)*mb*cos((q1+-1*q3))*q1d+(1/2*lb*(lta+ltb)*mb*cos((q2+-1*q3))*q2d+(Ib+1/4*(lb)^(2)*mb)*q3d));(-1*(lsa+lsb)*(lta*ms+ltb*(ms+mt))*cos((q1+-1*q4))*q1d+(-1*(lta+ltb)*(lta*ms+ltb*(ms+mt))*cos((q2+-1*q4))*q2d+((It+((lta)^(2)*ms+(2*lta*ltb*ms+(ltb)^(2)*(ms+mt))))*q4d+lsb*(lta+ltb)*ms*cos((q4+-1*q5))*q5d)));(-1*lsb*(lsa+lsb)*ms*cos((q1+-1*q5))*q1d+(-1*lsb*(lta+ltb)*ms*cos((q2+-1*q5))*q2d+(lsb*(lta+ltb)*ms*cos((q4+-1*q5))*q4d+(Is+(lsb)^(2)*ms)*q5d)));(-1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*cos(q1)*q1d+(-1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos(q2)*q2d+(-1/2*lb*mb*cos(q3)*q3d+((lta*ms+ltb*(ms+mt))*cos(q4)*q4d+lsb*ms*cos(q5)*q5d))));(-1*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*sin(q1)*q1d+(-1*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*sin(q2)*q2d+(-1/2*lb*mb*sin(q3)*q3d+((lta*ms+ltb*(ms+mt))*sin(q4)*q4d+lsb*ms*sin(q5)*q5d))));0;0]
end

function getqddImpact(q1,q2,q3,q4,q5,q1d,q2d,q3d,q4d,q5d)
	return ImpactLHS(q1,q2,q3,q4,q5)\ImpactRHS(q1,q2,q3,q4,q5,q1d,q2d,q3d,q4d,q5d)
end

function trimSignal(s,l,u)
	if s>u
		s=u
	end
	if s<l
		s=l
	end
	return s
end

function JacobianWholeBody(q1,q2,q3,q4,q5)
	return [-1*((mb+2*(ms+mt)))^(-1)*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*cos(q1) -1*((mb+2*(ms+mt)))^(-1)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*cos(q2) -1/2*lb*mb*((mb+2*(ms+mt)))^(-1)*cos(q3) ((mb+2*(ms+mt)))^(-1)*(lta*ms+ltb*(ms+mt))*cos(q4) lsb*ms*((mb+2*(ms+mt)))^(-1)*cos(q5);-1*((mb+2*(ms+mt)))^(-1)*(lsb*(mb+(ms+2*mt))+lsa*(mb+2*(ms+mt)))*sin(q1) -1*((mb+2*(ms+mt)))^(-1)*(ltb*(mb+(ms+mt))+lta*(mb+(ms+2*mt)))*sin(q2) -1/2*lb*mb*((mb+2*(ms+mt)))^(-1)*sin(q3) ((mb+2*(ms+mt)))^(-1)*(lta*ms+ltb*(ms+mt))*sin(q4) lsb*ms*((mb+2*(ms+mt)))^(-1)*sin(q5)]
