# for numerical dynamical simulation
function footSwingPos(q1,q2,q3,q4,q5)
	posx=(-1*(lsa+lsb)*sin(q1)+(-1*(lta+ltb)*sin(q2)+((lta+ltb)*sin(q4)+(lsa+lsb)*sin(q5))))
	posy=((lsa+lsb)*cos(q1)+((lta+ltb)*cos(q2)+(-1*(lta+ltb)*cos(q4)+-1*(lsa+lsb)*cos(q5))))
	return posx,posy
end

function kneeSwingPos(q1,q2,q3,q4,q5)
	posx=(-1*(lsa+lsb)*sin(q1)+-1*(lta+ltb)*(sin(q2)+-1*sin(q4)))
	posy=((lsa+lsb)*cos(q1)+(lta+ltb)*(cos(q2)+-1*cos(q4)))
	return posx,posy
end

function hipPos(q1,q2,q3,q4,q5)
	posx=(-1*(lsa+lsb)*sin(q1)+-1*(lta+ltb)*sin(q2))
	posy=((lsa+lsb)*cos(q1)+(lta+ltb)*cos(q2))
	return posx,posy
end

function torsoPos(q1,q2,q3,q4,q5)
	posx=(-1*(lsa+lsb)*sin(q1)+(-1*(lta+ltb)*sin(q2)+-1/2*lb*sin(q3)))
	posy=((lsa+lsb)*cos(q1)+((lta+ltb)*cos(q2)+1/2*lb*cos(q3)))
	return posx,posy
end

function kneeStancePos(q1,q2,q3,q4,q5)
	posx=-1*(lsa+lsb)*sin(q1)
	posy=(lsa+lsb)*cos(q1)
	return posx,posy
end

